import React from 'react'
import "./style.scss";
import {FaGithub} from 'react-icons/fa';
import {GrLinkedin,GrMail} from "react-icons/gr";

export default function Navbar() {
    return (
        <div className="navbar" data-scroll-section>
            <div>Menu</div>
            <div id="icons">
                <FaGithub id="git"/>
                <GrLinkedin id="linkd"/>
                <GrMail id="mail"/>
            </div>
        </div>
    )
}
